140).TAOCP1997init
list(`package:base` = function (seed) 
{
  KK <- 100
  LL <- 37
  MM <- as.integer(2^30)
  KKK <- KK + KK - 1
  KKL <- KK - LL
  ss <- seed - (seed%%2) + 2
  X <- integer(KKK)
  for (j in 1:KK) {
    X[j] <- ss
    ss <- ss + ss
    if (ss >= MM) 
      ss <- ss - MM + 2
  }
  X[2] <- X[2] + 1
  ss <- seed
  T <- 69
  while (T > 0) {
    for (j in KK:2) X[j + j - 1] <- X[j]
    for (j in seq(KKK, KKL + 1, -2)) X[KKK - j + 2] <- X[j] - (X[j]%%2)
    for (j in KKK:(KK + 1)) if (X[j]%%2 == 1) {
      X[j - KKL] <- (X[j - KKL] - X[j])%%MM
      X[j - KK] <- (X[j - KK] - X[j])%%MM
    }
    if (ss%%2 == 1) {
      for (j in KK:1) X[j + 1] <- X[j]
      X[1] <- X[KK + 1]
      if (X[KK + 1]%%2 == 1) 
        X[LL + 1] <- (X[LL + 1] - X[KK + 1])%%MM
    }
    if (ss) 
      ss <- ss%/%2
    else T <- T - 1
  }
  rs <- c(X[(LL + 1):KK], X[1:LL])
  invisible(rs)
}, function (seed) 
{
  KK <- 100
  LL <- 37
  MM <- as.integer(2^30)
  KKK <- KK + KK - 1
  KKL <- KK - LL
  ss <- seed - (seed%%2) + 2
  X <- integer(KKK)
  for (j in 1:KK) {
    X[j] <- ss
    ss <- ss + ss
    if (ss >= MM) 
      ss <- ss - MM + 2
  }
  X[2] <- X[2] + 1
  ss <- seed
  T <- 69
  while (T > 0) {
    for (j in KK:2) X[j + j - 1] <- X[j]
    for (j in seq(KKK, KKL + 1, -2)) X[KKK - j + 2] <- X[j] - (X[j]%%2)
    for (j in KKK:(KK + 1)) if (X[j]%%2 == 1) {
      X[j - KKL] <- (X[j - KKL] - X[j])%%MM
      X[j - KK] <- (X[j - KK] - X[j])%%MM
    }
    if (ss%%2 == 1) {
      for (j in KK:1) X[j + 1] <- X[j]
      X[1] <- X[KK + 1]
      if (X[KK + 1]%%2 == 1) 
        X[LL + 1] <- (X[LL + 1] - X[KK + 1])%%MM
    }
    if (ss) 
      ss <- ss%/%2
    else T <- T - 1
  }
  rs <- c(X[(LL + 1):KK], X[1:LL])
  invisible(rs)
})
