    else {
      n <- length(e)
      head <- if (p == 1) 
        NULL
      else e[1:(p - 1)]
      tail <- if (p == n) 
        NULL
      else e[(p + 1):n]
      macro <- e[[p]]
      mexp <- eval(macro[[2]], where)
      if (!is.vector(mexp) && !is.expression(mexp)) 
        stop("can only splice vectors")
      c(lapply(head, unquote), mexp, as.list(unquote.list(tail)))
    }
  }
  unquote(substitute(expr))
})
