      if (any(m == 0)) 
        stop("names do not match previous names")
      m
    }
    else stop("names do not match previous names")
  }
  allargs <- list(...)
  allargs <- allargs[lengths(allargs) > 0]
  if (length(allargs)) {
    nr <- vapply(allargs, function(x) if (is.data.frame(x)) 
      .row_names_info(x, 2)
      else if (is.list(x)) 
        length(x[[1]])
      else length(x), 1)
    if (any(n0 <- nr == 0)) {
      if (all(n0)) 
        return(allargs[[1]])
      allargs <- allargs[!n0]
    }
  }
  n <- length(allargs)
  if (n == 0) 
    return(list2DF())
  nms <- names(allargs)
  if (is.null(nms)) 
    nms <- character(n)
