          autoRnms <<- FALSE
        if (ni == 0) 
          character()
        else if (ni > 1) 
          paste(nmi, ri, sep = ".")
        else nmi
      }
      else if (autoRnms && nrow > 0 && identical(ri, seq_len(ni))) 
        as.integer(seq.int(from = nrow + 1, length.out = ni))
      else {
