    return(if (mis) NULL else init)
  f <- match.fun(f)
  if (!is.vector(x) || is.object(x)) 
    x <- as.list(x)
  ind <- seq_len(len)
  if (mis) {
    if (right) {
      init <- x[[len]]
      ind <- ind[-len]
    }
    else {
      init <- x[[1]]
      ind <- ind[-1]
    }
  }
  if (!accumulate) {
    if (right) {
      for (i in rev(ind)) init <- forceAndCall(2, f, x[[i]], init)
    }
    else {
      for (i in ind) init <- forceAndCall(2, f, init, x[[i]])
    }
    init
  }
  else {
    len <- length(ind) + 1
    out <- vector("list", len)
    if (mis) {
      if (right) {
        out[[len]] <- init
        for (i in rev(ind)) {
          init <- forceAndCall(2, f, x[[i]], init)
          out[[i]] <- init
        }
      }
      else {
        out[[1]] <- init
        for (i in ind) {
