  okay <- rep(FALSE, nf)
  for (i in seq_len(nf)) {
    fr <- paste0("\\??\\", normalizePath(from[i]))
    link <- to[i]
    if (file.exists(link)) {
      warning(gettextf("link '%s' already exists", link), domain = NA)
