      yri <- substr(veri, 1, 4)
      sufi <- substr(veri, 5, 5)
      yrs <- substr(vers, 1, 4)
      sufs <- substr(vers, 5, 5)
      if (yrs > yri || (yrs == yri && sufs > sufi)) 
