      installChoice <- menu(c("yes", "no"))
      if (installChoice == 1) {
        hasBioc <- any(pkg[!good] %in% bioc)
        if (!hasBioc) {
          install.packages(pkg[!good])
        }
        else {
          inst <- pkg[!good]
          instC <- inst[!(inst %in% bioc)]
          instB <- inst[inst %in% bioc]
