  index <- 1:nrow(x)
  if (!maximize) {
    bestIndex <- which.min(x[, metric])
    perf <- x[bestIndex, metric] + (x[bestIndex, paste(metric, "SD", sep = "")])/sqrt(num)
    candidates <- index[x[, metric] <= perf]
    bestIter <- min(candidates)
  }
  else {
    bestIndex <- which.max(x[, metric])
    perf <- x[bestIndex, metric] - (x[bestIndex, paste(metric, "SD", sep = "")])/sqrt(num)
    candidates <- index[x[, metric] >= perf]
    bestIter <- min(candidates)
  }
