      modelPred
    else rbind(rfePred, modelPred)
    if (!exists("modImp")) {
      if (rfeControl$verbose) {
        cat("+(rfe) imp", ifelse(label != "", label, ""), "\n")
      }
      modImp <- rfeControl$functions$rank(fitObject, x[, retained, drop = FALSE], y)
