  if (linearVars > 0) {
    lin <- seq(10, 1, length = linearVars)/4
    lin <- lin * rep(c(-1, 1), floor(linearVars) + 1)[1:linearVars]
    for (i in seq(along = lin)) lp <- lp + tmpData[, i + 3] * lin[i]
