  if (is.null(x) && null.ok) 
    return(TRUE)
  ord = inherits(x, classes, TRUE)
  w = wf(ord == 0)
  if (length(w) > 0) {
    cl = class(x)
    return(sprintf("Must inherit from class '%s', but has class%s '%s'", classes[w], if (length(cl) > 1) "es" else "", paste0(cl, collapse = "','")))
