  if (length(w) > 0) 
    return(sprintf("Path to file (dirname) does not exist: '%s' of '%s'", dn[w], x[w]))
  w = which(file.exists(x))
  if (length(w) > 0) {
    if (overwrite) 
      return(checkAccess(dn, "w") %and% checkAccess(x[w], "rw"))
