{
  assertCharacter(choices, min.len = 1)
  assertFlag(several.ok)
  if (several.ok) {
    if (identical(x, choices)) 
      return(x)
    assertCharacter(x, min.len = 1, .var.name = .var.name, add = add)
    x = choices[pmatch(x, choices, nomatch = 0, duplicates.ok = TRUE)]
