      return(x[1])
    assertCharacter(x, len = 1, .var.name = .var.name, add = add)
    x = choices[pmatch(x, choices, nomatch = 0, duplicates.ok = FALSE)]
    assertChoice(x, choices, .var.name = .var.name, add = add)
  }
  x
